@Override
public SeekStatus seekCeil(BytesRef target, boolean useCache) throws IOException {
  decoded = false;
  term = doSeekCeil(target);
  if (term == null) {
    return SeekStatus.END;
  } else {
    return term.equals(target) ? SeekStatus.FOUND : SeekStatus.NOT_FOUND;
  }
}

